    fontWeight: 'bold',
    textTransform: 'uppercase',
    textDecoration: 'none',
    color: 'white',

    backgroundImage: "linear-gradient(to right, #FD297B, #FF655B)",
    padding: '5px',

    width:'200px',
    height:'auto',
    textAlign:'center',

    borderRadius: '20px',
}

const logoStyle = {

}

const linkStyle = {
    position:'absolute',
